import React from 'react';
import './Header.css';
import { useNavigate } from 'react-router-dom';

const Header = () => {
    const navigate = useNavigate();

    const handleClick = () => {
        // Navigate to /your-link
        navigate('/login');
      };
  return (

    <div>
      <nav class="navbar navbar-expand-xl navbar-dark bg-lightOFF">
        <a href='/'>
		      <div class="logo-group">
			      <img src="/assets/images/logo_main.png" alt="Phishducation logo"></img>
		      </div>
	      </a>
        <div>
          <ul class="navbar-nav ml-auto" style={{margin: "0px"}}>
            <li class="nav-item">
              <a href = '/signup' style={{paddingRight: "5px"}}>Register</a>
            </li>
            <li class="nav-item">
              <button class="logBtn" onClick={handleClick} style={{paddingRight: "5px"}}>Login</button>
            </li>
          </ul>
        </div>
      </nav>
 	  </div>
  );
};

export default Header;
